# main_gui_final.py - نسخة نهائية بدون تبعيات خارجية
# تواصل مع المطور: Instagram @wx.ero
# كلمة السر للدخول: wxero

import tkinter as tk
from tkinter import messagebox, simpledialog
import json, os, random, time, threading, base64, tempfile, string, winsound

ACC_FILE = "الحسابات.json"
PASSWORD = "wxero"

# ------------------ أصوات مضمّنة كـ Base64 ------------------

BG_WAV_B64 = """ 

"""

CLICK_WAV_B64 = """

"""

def extract_wav(b64_string, suffix):
    data = base64.b64decode(b64_string)
    fd, path = tempfile.mkstemp(suffix=suffix)
    with os.fdopen(fd, 'wb') as f:
        f.write(data)
    return path

def play_background_loop(path):
    winsound.PlaySound(path, winsound.SND_FILENAME | winsound.SND_ASYNC | winsound.SND_LOOP)

def play_click(path):
    winsound.PlaySound(path, winsound.SND_FILENAME | winsound.SND_ASYNC)

def save_account(acc):
    accounts = load_accounts()
    accounts.append(acc)
    with open(ACC_FILE, 'w', encoding='utf-8') as f:
        json.dump(accounts, f, ensure_ascii=False, indent=4)

def load_accounts():
    if not os.path.exists(ACC_FILE):
        return []
    with open(ACC_FILE, 'r', encoding='utf-8') as f:
        return json.load(f)

def gen_data():
    name = ''.join(random.choices(string.ascii_lowercase, k=7)).capitalize()
    email = f"{name.lower()}{random.randint(100,999)}@gmail.com"
    username = f"{name.lower()}{random.randint(100,9999)}"
    password = ''.join(random.choices(string.ascii_letters + string.digits, k=10))
    return {"name": name, "email": email, "username": username, "password": password}

def cmd_click(fn):
    def wrapper(*args, **kwargs):
        threading.Thread(target=lambda: play_click(click_path), daemon=True).start()
        return fn(*args, **kwargs)
    return wrapper

@cmd_click
def create_account():
    data = gen_data()
    save_account(data)
    messagebox.showinfo("تم الإنشاء", f"حساب جديد:\n{data['username']} / {data['password']}")
    app.update_count()

@cmd_click
def create_multiple():
    try:
        n = simpledialog.askinteger("عدد الحسابات", "كم حساب تريد إنشاءه؟")
        if n:
            for _ in range(n):
                create_account()
    except:
        messagebox.showwarning("خطأ", "الرجاء إدخال عدد صحيح")

@cmd_click
def send_followers():
    accounts = load_accounts()
    if not accounts:
        messagebox.showwarning("لا توجد حسابات", "أنشئ حسابات أولاً")
        return
    target = simpledialog.askstring("المستهدف", "اسم الحساب المستهدف:")
    num = simpledialog.askinteger("المتابعين", "كم عدد المتابعين؟")
    if target and num:
        sent = 0
        for acc in accounts:
            if sent >= num: break
            time.sleep(random.uniform(0.5,1.5))
            sent += 1
        messagebox.showinfo("تم الإرسال", f"أُرسل {sent} متابع إلى @{target}")

@cmd_click
def show_accounts():
    accounts = load_accounts()
    msg = "\n".join(f"{a['username']} | {a['email']}" for a in accounts) if accounts else "لا توجد حسابات"
    messagebox.showinfo("الحسابات", msg)

class App:
    def __init__(self, root):
        self.root = root
        root.title("Insta Followers Booster")
        root.geometry("600x450")
        root.configure(bg="#0f0f0f")

        bg_path = extract_wav(BG_WAV_B64, '.wav')
        threading.Thread(target=lambda: play_background_loop(bg_path), daemon=True).start()

        tk.Label(root, text="لوحة التحكم", font=("Helvetica", 22, "bold"),
                 fg="#00FFAA", bg="#0f0f0f").pack(pady=10)

        self.count_label = tk.Label(root, text=self.get_count(),
                                    font=("Helvetica", 12), fg="#cccccc", bg="#0f0f0f")
        self.count_label.pack(pady=5)

        buttons = [
            ("إنشاء حساب", create_account),
            ("إنشاء عدة حسابات", create_multiple),
            ("إرسال متابعين", send_followers),
            ("عرض الحسابات", show_accounts),
            ("خروج", root.quit)
        ]
        for txt, cmd in buttons:
            btn = tk.Button(root, text=txt, command=cmd,
                            font=("Helvetica", 12), bg="#222", fg="#00ffaa", width=30)
            btn.pack(pady=5)

        self.footer = tk.Label(root, text="تواصل مع المطور: Instagram @wx.ero",
                               font=("Consolas", 10, "bold"), fg="#ff00aa", bg="#0f0f0f")
        self.footer.pack(side="bottom", pady=10)
        self.glitch_footer()

    def glitch_footer(self):
        orig = "تواصل مع المطور: Instagram @wx.ero"
        def anim():
            while True:
                frame = "".join(c if random.random()>0.2 else random.choice("!@#$%^&*") for c in orig)
                self.footer.config(text=frame)
                time.sleep(0.1)
                self.footer.config(text=orig)
                time.sleep(0.5)
        threading.Thread(target=anim, daemon=True).start()

    def get_count(self):
        return f"عدد الحسابات المخزنة: {len(load_accounts())}"

    def update_count(self):
        self.count_label.config(text=self.get_count())

def ask_password():
    root = tk.Tk(); root.withdraw()
    pwd = simpledialog.askstring("كلمة السر", "أدخل كلمة السر:", show="*")
    root.destroy()
    return pwd == PASSWORD

def main():
    global click_path
    click_path = extract_wav(CLICK_WAV_B64, '.wav')
    if ask_password():
        root = tk.Tk()
        global app
        app = App(root)
        root.mainloop()
    else:
        messagebox.showerror("خطأ", "كلمة السر خاطئة")

if __name__ == "__main__":
    main()
